import './App.css';


const App = ()=> {
  const [counter, setCounter]=useState(0);
  return (
    <div className="App">
      <button onClick={()=> setCounter((prevCounter)=>prevCounter - 1)}>-</button>
      <h1>{counter}</h1>
      <button>+</button>

    </div>
  );
}

export default App;
